import React, { Component } from "react";
import { connect } from "react-redux";
import { MDBContainer, MDBIcon, MDBRow, MDBCol, MDBBtn } from "mdbreact";
export class home extends Component {
  render() {
    return (
      <MDBContainer className="bg">
        <MDBRow>
          <MDBCol size="6" className="mt-5">
            <h1>Binevenue dans votre espace personnel :</h1>
            <h3>
              <strong>
                <MDBIcon icon="search" />
                &nbsp;&nbsp;
              </strong>
              Trouvez votre sallon de béauté préférer en ligne
            </h3>
            <h3>
              <strong>
                <MDBIcon far icon="address-book" />
                &nbsp;&nbsp;
              </strong>
              Reservez votre millieur prestation
            </h3>
            <h3>
              <strong>3-&nbsp;&nbsp;</strong>Suivi votre reservation et
              recevoire la comfirmation
            </h3>
            <h3>
              <strong>4-</strong>Ganger le temps de chercher
            </h3>
            <MDBBtn outline>Voitre notre catégorie de salons de beauté</MDBBtn>
          </MDBCol>
          <MDBCol size="6" className="mt-5">
            <MDBRow>
              <img
                className="img-fluid"
                src="https://image.freepik.com/free-vector/search-engine-concept-illustration_114360-286.jpg"
                alt=""
              />
            </MDBRow>
          </MDBCol>
        </MDBRow>
      </MDBContainer>
    );
  }
}

const mapStateToProps = (state) => ({});

const mapDispatchToProps = {};

export default connect(mapStateToProps, mapDispatchToProps)(home);
